<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
	<title>mineSweeper Game</title>
	<style>
		*{
 			-webkit-touch-callout: none;
  			-webkit-user-select: none;
  			-khtml-user-select: none;
 			-moz-user-select: none;
  			-ms-user-select: none;
  			user-select: none;

		}

		body{
			display: flex;
			justify-content: center;
			align-items: center;
			flex-direction: column;
			font-family: Arial, Helvetica, sans-serif;
			background-color: rgb(20, 20, 20);
		}

		td{
		  border: 1px solid white;
		  text-align: center;
		}
		
	  	#tbl td{
	  	  height: 20px;
	  	  width: 20px;
		  color: white;
	 	}

	  	#header div{
			padding: auto 25px;
	 	}

		.cbutton{
			height: 100%;
			width: 100%;
			background-color: lime;
			position: relative;
			z-index: 2;
			background-position: center center;
			background-size: 100% 100%;
		}

		div[role=button]{
			cursor: pointer;
		}

		.fbuttonActivation{
			background-color: rgb(50, 50, 50)!important;
			color: white;
			cursor: default;
		}

		#header div[role]:active{
			background-color: rgb(50, 50, 50)!important;
			color: white;
			cursor: default;
		}

		#theBigTable{
			
		}

		#editWindow table td{
			border: none;
			text-align: center;
		}

		#editSetButton{
			padding: 10px 20px 10px 20px;
			border:1px solid white;
			background-color: lime;
		}

		#editWindow input{
			width:20px;
			height:20px;
		}

		#editWindow{
			background-color: white;
    		z-index: 2;
    		position: absolute;
    		top: 27px;
    		left: 3px;
    		height: 200px;
    		width: 226px;
    		padding-left: 38px;
    		padding-top: 64px;
		    display: block;
		}

		#wingif,#losegif{
			position: absolute;
   			top: 0px;
   			left: 0px;
   			width: 100%;
   			height: 100%;
    		z-index: 3;
			display:none;
		}

	</style>
</head>
<body>
	<br>
	<br>
	<br>
	<h1 style="color:red;">MINE SWEEPER</h1>
	<br>
	<br>
	<br>
	<div id="editWindow">
		<table>
			<tr>
				<td>height</td>
				<td>width</td>
				<td>mines</td>
			</tr>
			<tr>
				<td><input type="text" id="heightInput" required min="2" max="12"></td>
				<td><input type="text" id="widthInput" required min="2" max="12"></td>
				<td><input type="text" id="minesInput" required min="1" max="12"></td>
			</tr>
			<tr>
				<td></td>
				<td colspan="1"><div role="button" id="editSetButton" onclick="
					startGame(
						document.getElementById('heightInput').value,
						document.getElementById('widthInput').value,
						document.getElementById('minesInput').value
					);
					document.getElementById('editWindow').style.display='none';
					">START</div></td>
				<td></td>
			</tr>
		</table>
	</div>
	<table id="theBigTable">
		<tr id="header">
			<td><div style="background-color: white" id="edit" role="button" onclick="document.getElementById('editWindow').style.display='block';document.getElementById('wingif').style.display='none';document.getElementById('losegif').style.display='none';">edit</div></td>
			<td><div style="background-color: white" id="replay" role="button" onclick="startGame(h,w,m);document.getElementById('wingif').style.display='none';document.getElementById('losegif').style.display='none';">replay</div></td>
			<td style="background-color: white" id="minesRemained">mines remained:</td>
		</tr>

							<td><div style="background-color: white" id="cursor" onclick="footerButtons(0)" role="button">cursor</div></td>
							<td><div style="background-color: white" id="sign" onclick="footerButtons(1)" role="button">sign</div></td>
							<td><div style="background-color: white" id="qmark" onclick="footerButtons(2)" role="button">qmark</div></td>

	<script>
	var mns;
	var h=0,w=0,m=0;
	var clickType=0;
	var ma=[];
	function arraySearch(a,s){
	//as a is the array and s is the object to search
		var f=-1;
		for(let i=0;i<a.length;i++){
			if(a[i][0]==s[0] && a[i][1]==s[1]){
				f=i;
			}
		}
		return f;
	}

	function win(){
		document.getElementById('wingif').style.display='block';
	}

	function lose(){
		document.getElementById('losegif').style.display='block';
	}

	function bclick(x,y){
		let pos=x+(w*y);
		let button=document.getElementById("cvr"+x+"_"+y);
		if(clickType==0){
			if(ma[pos][3]==0){
				ma[pos][3]=3;
				button.style.visibility="hidden";
				if(ma[pos][2]==9){
					document.getElementById("tbl").getElementsByTagName("td")[pos].style.backgroundColor='#D5573B';
					lose();
					document.getElementById("tbl").getElementsByTagName("td")[pos].style.backgroundColor='red';
				}else{
					document.getElementById("tbl").getElementsByTagName("td")[pos].innerHTML=(ma[pos][2]==0)?"":ma[pos][2];
					let f=true;
					for(let i=0;i<w*h;i++){
						if(ma[i][2]!=9 && ma[i][3]!=3){
							f=false;
						}
					}
					if(f){
						win();
					}
					if(ma[pos][2]==0){
						let p=(y*w)+x;
						if(p-w >= 0 && (p%w)-1 >= 0){
							if(ma[p-1-w][3]==0){
								document.getElementById("cvr"+(x-1)+"_"+(y-1)).click();
							}
						}
					    if(p-w >= 0){
							if(ma[p-w][3]==0){
								document.getElementById("cvr"+(x)+"_"+(y-1)).click();
							}
						}
					    if(p-w >= 0 && ((p+1)%w)-1 >=0){
							if(ma[p+1-w][3]==0){
								document.getElementById("cvr"+(x+1)+"_"+(y-1)).click();
							}
						}
					    if((p%w)-1 >=0){
							if(ma[p-1][3]==0){
								document.getElementById("cvr"+(x-1)+"_"+(y)).click();
							}
						}
					    if(((p+1)%w)-1 >=0){
							if(ma[p+1][3]==0){
								document.getElementById("cvr"+(x+1)+"_"+(y)).click();
							}
						}
					    if((p%w)-1 >=0 && (h-1)*w-1-p >=0){
							if(ma[p-1+w][3]==0){
								document.getElementById("cvr"+(x-1)+"_"+(y+1)).click();
							}
						}
					    if((h-1)*w-1-p >=0){
							if(ma[p+w][3]==0){
								document.getElementById("cvr"+(x)+"_"+(y+1)).click();
							}
						}
					    if((h-1)*w-1-p >=0 && ((p+1)%w)-1 >=0){
							if(ma[p+1+w][3]==0){
								document.getElementById("cvr"+(x+1)+"_"+(y+1)).click();
							}
						}
					}
				}
			}
		}else if(clickType==1){
			if(ma[pos][3]==1){
				ma[pos][3]=0;
				button.style.backgroundImage="none";
				++mns;
			}else{
				ma[pos][3]=1;
				button.style.backgroundImage="url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAGQAAABkAgMAAAANjH3HAAAAAXNSR0IB2cksfwAAAAlwSFlzAAAOxAAADsQBlSsOGwAAAAlQTFRFAAAAAAAA7Rwk+C0TvwAAAAN0Uk5TAP//RFDWIQAAAMlJREFUeJzt0LsRgzAQRVEcuAT6oQQH0I9KUahRlTb6j/ZdB/5kbLhnRhd2Wf4063EElMjiUDyKDp2iQ0lkKIkMJZGhJDKURYWyqFAWFcqiQkVEqIgIFRGhIiJUxYaq2FAVG6piQ01MqIkJNTGhJibUZQ51mUNd5lCXOTSIQ/EoASWyOBSPElAii0PxKAElsjgUjxJQ4k9l6ix6LrnkkrfyWtcZtvdjnkfa38z+nI3gJPtUfXAF2T8S7vC38f/IG+zDhYY1HPy7eQI+dHlDToM1UgAAAABJRU5ErkJggg==')";
				--mns;
			}
			document.getElementById("minesRemained").innerHTML="mines remained: "+mns;
		}else if(clickType==2){
			if(ma[pos][3]==2){
				ma[pos][3]=0;
				button.style.backgroundImage="none";
			}else{
				ma[pos][3]=2;
				button.style.backgroundImage="url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAGQAAABkAQMAAABKLAcXAAAAAXNSR0IB2cksfwAAAAlwSFlzAAAOxAAADsQBlSsOGwAAAAZQTFRFAAAAAAAApWe5zwAAAAJ0Uk5TAP9bkSK1AAAA00lEQVR4nO3SOw6DMAwGYEcZWCpxgaq5CbkYohwtR+EIjAwIt3n7l1ALqGM9RHwosQ0x0e9CsZThWYh5q9DMPBa1b0312Ea8FD1nMmtNMpIuaZR/KhW132Vz0saXNi4XmPIS5PKGUM4f0Vk2JF52NYQ1N9OLNb8dkuKJbk8pm0mavyt+ko7dt2elnFSKqzIoOioL6kADqAetoEVCgbSctHq3Icq9x8YcNDZKwfTqTaqFVlgWb8Ts+qGXKQ0ksdAz1saf8td53elo3EAPkP2gq/V24wV4KFNhUzvd0AAAAABJRU5ErkJggg==')";
			}
		}
	}

	function footerButtons(x){
		if(x==0){
			clickType=0;
			document.getElementById("cursor").classList.add("fbuttonActivation");
			document.getElementById("sign").classList.remove("fbuttonActivation");
			document.getElementById("qmark").classList.remove("fbuttonActivation");
		}else if(x==1){
			clickType=1;
			document.getElementById("cursor").classList.remove("fbuttonActivation");
			document.getElementById("sign").classList.add("fbuttonActivation");
			document.getElementById("qmark").classList.remove("fbuttonActivation");
		}else if(x==2){
			clickType=2;
			document.getElementById("cursor").classList.remove("fbuttonActivation");
			document.getElementById("sign").classList.remove("fbuttonActivation");
			document.getElementById("qmark").classList.add("fbuttonActivation");
		}
	}

function startGame(poi,iop,opi){
	ma=[];
	h=poi;
	w=iop;
	m=opi;
	mns=m;
	document.getElementById("cursor").classList.add("fbuttonActivation");
	document.getElementById("editWindow").style.display = 'none';

	//state mines number
	document.getElementById("minesRemained").innerHTML="mines remained: "+mns;
	
	//set ma array [x,y,mines,case]
	/*cases
		0 = default
		1 = sign
		2 = qmark
		3 = discoverd
	*/
	for (let i = 0; i < h; i++) {
		for (let j = 0; j < w; j++) {
			ma.push([i,j,null,0]);
		}
		
	}

	document.getElementById("tbl").innerHTML="";
	//create cells
	for(let i=0;i<h;i++){
	  document.getElementById("tbl").innerHTML+="<tr></tr>";
	  for(let j=0;j<w;j++){
	    document.getElementById("tbl").getElementsByTagName("tr")[i].innerHTML+="<td></td>";
	  }
	}

	//create cell buttons
	for(let i=0;i<w;i++){
	  for(let j=0;j<h;j++){
	    document.getElementById("tbl").getElementsByTagName("td")[i+(w*j)].innerHTML+="<div role=button class=cbutton id='cvr"+i+"_"+j+"' onclick='bclick("+i+","+j+")'>";
	  }
	}
	   
	//set mines
	for(let i=0;i<m;i++){
	  var wr=Math.floor(Math.random() * w);
	  var hr=Math.floor(Math.random() * h);
	  if(wr+(hr*w)-1>=0 && wr+(hr*w)-1<=300){
	  	if(ma[wr+(hr*w)-1][2]!=null){
	  	  i-=1;
	  	}else{
	    	ma[wr+(hr*w)-1][2]=9;
	  	}
	  }
	  else{
		i-=1;
	  }
	}
	    
	//set numbers
	for(let j=0;j<w;j++){
	  for(let i=0;i<h;i++){
		var p=(j*w)+i;
	    if(ma[p][2]!=9){
	      var mn=0;
	      if(p-w >= 0 && (p%w)-1 >= 0){//1
			if(ma[p-1-w][2]==9){
				mn++;
			}
		}
	      if(p-w >= 0){//2
			if(ma[p-w][2]==9){
				mn++;
			}
		}
	      if(p-w >= 0 && ((p+1)%w)-1 >=0){//3
			if(ma[p+1-w][2]==9){
				mn++;
			}
		}
	      if((p%w)-1 >=0){//4
			if(ma[p-1][2]==9){
				mn++;
			}
		}
	      if(((p+1)%w)-1 >=0){//6
			if(ma[p+1][2]==9){
				mn++;
			}
		}
	      if((p%w)-1 >=0 && (h-1)*w-1-p >=0){//7
			if(ma[p-1+w][2]==9){
				mn++;
			}
		}
	      if((h-1)*w-1-p >=0){//8
			if(ma[p+w][2]==9){
				mn++;
			}
		}
	      if((h-1)*w-1-p >=0 && ((p+1)%w)-1 >=0){//9
			if(ma[p+1+w][2]==9){
				mn++;
			}
		}
		//document.getElementById("tbl").getElementsByTagName("td")[p].innerHTML=mn;
		ma[p][2]=mn;
	    }
	  }
	}
}
	  document.getElementById("editWindow").style.display = "none";
startGame(10,10,10);
	</script>
